import React from "react";
import { useImage } from "../context/ImageContext";

const ImagePreview = () => {
  const { preview } = useImage();
  console.log(preview);

  return (
    <div>
      {preview ? (
        <img src={preview} alt="Image Preview" style={{ maxWidth: "100%" }} />
      ) : (
        <p>No image uploaded yet</p>
      )}
    </div>
  );
};

export default ImagePreview;
